import { FETCH_CODE, FETCH_NAME } from "../actions/types";

const initialState = {
  carrierCode: "",
  carrierName: ""
};

export default function(state = initialState, action) {
  switch (action.type) {
    case FETCH_CODE:
      return {
        ...state,
        carrierCode: action.payload.carrierCode
      };
    case FETCH_NAME:
      return {
        ...state,
        carrierName: action.payload.carrierName
      };
    default:
      return state;
  }
}
